import React from "react";
import { Carousel, Image } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

const Poto = () => {
  return (
    <Carousel.Item style={{ height: "150px" }}>
      <img src="/image/1.jpg" style={{ width: "100%", height: "150px" }} />
    </Carousel.Item>
  );
};

export default Poto;
